import { useDispatch } from 'react-redux';

import { TABS } from '../redux/actions/type';

import { toggleTab } from '../redux/actions';

const Tabs = ({ current}) => {

    const dispatch = useDispatch();

    return (
        TABS.map( tab => (
            <button className='btn'
                    onClick={() => dispatch(toggleTab(tab))}
            >
                {tab}
            </button>
        ))
    )
}

export default Tabs;
